  @Test def testAll(): Unit = {
    val testFirstCPs = makeTestFirstCPs()
    val testLastCPs = makeTestLastCPs()
    val testDatas = makeTestDatas()

    var i = 0

    while (i < testFirstCPs.length) {
      val entry = Entry(testFirstCPs(i), testLastCPs(i), testDatas(i))

      for (cp <- entry.firstCP to entry.lastCP) {
        val cpStr = cp.toHexString

        assertEquals(s"getType($cpStr)", entry.tpe, getType(cp))

        // BEGIN GENERATED: [test-properties]
        assertEquals(s"isLowerCase($cpStr)", entry.hasFlag(16384), isLowerCase(cp))
        assertEquals(s"isUpperCase($cpStr)", entry.hasFlag(32768), isUpperCase(cp))
        assertEquals(s"isTitleCase($cpStr)", entry.hasFlag(2097152), isTitleCase(cp))
        assertEquals(s"isDigit($cpStr)", entry.hasFlag(131072), isDigit(cp))
        assertEquals(s"isDefined($cpStr)", entry.hasFlag(64), isDefined(cp))
        assertEquals(s"isLetter($cpStr)", entry.hasFlag(8192), isLetter(cp))
        assertEquals(s"isLetterOrDigit($cpStr)", entry.hasFlag(1024), isLetterOrDigit(cp))
        assertEquals(s"isAlphabetic($cpStr)", entry.hasFlag(512), isAlphabetic(cp))
        assertEquals(s"isIdeographic($cpStr)", entry.hasFlag(524288), isIdeographic(cp))
        assertEquals(s"isJavaIdentifierStart($cpStr)", entry.hasFlag(2048), isJavaIdentifierStart(cp))
        assertEquals(s"isJavaIdentifierPart($cpStr)", entry.hasFlag(128), isJavaIdentifierPart(cp))
        assertEquals(s"isUnicodeIdentifierStart($cpStr)", entry.hasFlag(4096), isUnicodeIdentifierStart(cp))
        assertEquals(s"isUnicodeIdentifierPart($cpStr)", entry.hasFlag(256), isUnicodeIdentifierPart(cp))
        assertEquals(s"isIdentifierIgnorable($cpStr)", entry.hasFlag(262144), isIdentifierIgnorable(cp))
        assertEquals(s"isSpaceChar($cpStr)", entry.hasFlag(1048576), isSpaceChar(cp))
        assertEquals(s"isWhitespace($cpStr)", entry.hasFlag(4194304), isWhitespace(cp))
        assertEquals(s"isISOControl($cpStr)", entry.hasFlag(8388608), isISOControl(cp))
        assertEquals(s"isMirrored($cpStr)", entry.hasFlag(65536), isMirrored(cp))
        // END GENERATED: [test-properties]
      }

      i += 1
    }
  }
}

